export default function fieldHandler() {
  const addField = (field) => {
    field.push({
      id: Math.random(),
      type: '',
      title: 'Overskrift',
      value: ''
    });
  }

  const deleteField = (field, index) => {
    console.log(field);
    field.splice(index, 1);
  }

  return {
    addField, deleteField
  }
}
